import React from "react";
import PropTypes from "prop-types";
import { Container, Row, Col } from "shards-react";

import MainNavbar from "..DELETED_BASE64_STRING";
import TenantSpacesSidebar from "..DELETED_BASE64_STRING";
import MainFooter from "../components/layout/MainFooter";

const TenantSpaces = ({ children, noNavbar, noFooter }) => (
  <Container fluid>
    <Row>
      <TenantSpacesSidebar />
      <Col
        className="main-content p-0"
        lg={{ size: 10, offset: 2 }}
        md={{ size: 9, offset: 3 }}
        sm="12"
        tag="main"
      >
        {!noNavbar && <MainNavbar />}
        {children}
        {!noFooter && <MainFooter />}
      </Col>
    </Row>
  </Container>
);

TenantSpaces.propTypes = {
  /**
   * Whether to display the navbar, or not.
   */
  noNavbar: PropTypes.bool,
  /**
   * Whether to display the footer, or not.
   */
  noFooter: PropTypes.bool
};

TenantSpaces.defaultProps = {
  noNavbar: false,
  noFooter: false
};

export default TenantSpaces;
